 Dynasty from the South, Harshavardhana, The Pallavas, The Rajputs from the Central and North Western India, the Mughals, Sivaji Maharaj and the Marathas, Hyder Ali and Tipu Sultan of Mysore and Rani of Jhansi , Laxmibai.\n\n"},{"text":"00:01","navigationEndpoint":{"clickTrackingParams":"CEAQzasBGAEiEwi-3-ea6pHqAhVCjHwKHfzCBX0=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=Ihd3uh6jUqo\u0026t=1s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"Ihd3uh6jUqo","continuePlayback":true,"startTimeSeconds":1}}},{"text":"  Pandya Dynasty - Indian History | Mocomi Kids\n"},{"text":"01:39","navigationEndpoint":{"clickTrackingParams":"CEAQzasBGAEiEwi-3-ea6pHqAhVCjHwKHfzCBX0=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=Ihd3uh6jUqo\u0026t=99s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"Ihd3uh6jUqo","continuePlayback":true,"startTimeSeconds":99}}},{"text":"  Persian and Greek Invaders | Mocomi Kids\n"},{"text":"03:12","navigationEndpoint":{"clickTrackingParams":"CEAQzasBGAEiEwi-3-ea6pHqAhVCjHwKHfzCBX0=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=Ihd3uh6jUqo\u0026t=192s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"Ihd3uh6jUqo","continuePlayback":true,"startTimeSeconds":192}}},{"text":"  Chola Empire History | Mocomi Kids\n"},{"text":"07:17","navigationEndpoint":{"clickTrackingParams":"CEAQzasBGAEiEwi-3-ea6pHqAhVCjHwKHfzCBX0=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=Ihd3uh6jUqo\u0026t=437s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"Ihd3uh6jUqo","continuePlayback":true,"startTimeSeconds":437}}},{"text":"  Mauryans - Maurya Dynasty History | Mocomi Kids\n"},{"text":"09:54","navigationEndpoint":{"clickTrackingParams":"CEAQzasBGAEiEwi-3-ea6pHqAhVCjHwKHfzCBX0=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=Ihd3uh6jUqo\u0026t=594s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}}
